ERRO_PONTO: .asciiz "Ponto fora do limite"

.text

MAIN:  
	jal MAPA
	# Close the file 
	li   $v0, 16       # system call for close file
	move $a0, $s6      # file descriptor to close
	syscall            # close file
	jal EXIT
	
EXIT:	li $v0, 10
	syscall
		
MAPA:
	addi $sp,$sp,-4
	sw $ra,0($sp)
	la $s0,map_vetor
	li $s1,0
	li $s2,0
	la $s3,X
	la $s4,Y
while_mapa:
	beq $s2,$s4,exit_map	
	beq $s1,$s3,reseta_x
	move $a0,$s1
	move $a1,$s2
	lbu $a2,0($s0)
	jal PONTO
	addi $s1,$s1,1
	addi $s0,$s0,1
	j while_mapa
reseta_x:
	li $s1,0
	addi $s2,$s2,1
	j while_mapa
exit_map:
	lw $ra,0($sp)
	addi $sp,$sp,4
	jr $ra

	
#$a0 = x, $a1 =y , $a2 = cor	
PONTO: 	la $t0, VGA_BASE
	la $t2, X
	la $t3, Y
	slt $t4,$a0,$t2 # a0 < $t2(X)
	beqz $t4,ponto_fora_limite
	slt $t4,$a1,$t3 # a1 < $t3(Y)
	beqz $t4,ponto_fora_limite
	mul $t1, $a1, $t2 # $t1 = $a1(y) * 320; 
	add $t1, $t1, $a0 # $t1 = $t1($a1(y) * 320) + $a0(x); 
	add $t0, $t0, $t1 # $t0 = 0xFF000000 + y * 320 + x
	sb $a2, 0($t0) # salva $a2 (cor) no byte que $t0 corresponde.
	addi $v0,$zero,0
	jr $ra
ponto_fora_limite:
	addi $v0,$zero,4 # x ou y esto fora do limite
	la $a0, ERRO_PONTO
	syscall
	jr $ra
